1,movie/edit,movie/edit/2,POST,"*""title"":""The Amazing Spiderman"",""description"":""<?php\r\n\/**\r\n * Description of movie *\r\n * @author generator\r\n *\/\r\n\r\nclass movie extends app_crud_controller {\r\n\tfunction _config_grid() {\r\n        $config = parent::_config_grid();\r\n        $config['fields'] = array('cover','title','description','preview');\r\n        \/\/ $config['names'] = array('No. SK Pensiun','NIP AP. I','Nama Peserta','Nomor Kartu Keluarga','Nomor Induk Kependudukan','Tempat Lahir','Tanggal Lahir','Foto Peserta');\r\n        $config['formats'] = array('callback_foto_1','','','');\r\n        return $config;\r\n    }\r\n\r\n    function foto_1($value) {\r\n\r\n        if (!empty($value)) {\r\n            return '<img src =\"' . base_url('data\/' . $value) . '\" width=\"68\" height=\"\">';\r\n        } else {\r\n            return \"\";\r\n        }\r\n    }\r\n\r\n    function _save($id= null) {\r\n        if ($_POST) {\r\n            $this->load->library('upload');\r\n\r\n            if (!empty($_FILES)) {\r\n                foreach ($_FILES as $key => $file) {\r\n                    if ($file['error'] == 0) {\r\n\r\n                        $config = array();\r\n                        $config['upload_path'] = '.\/data\/movie\/' . $key;\r\n                        $config['allowed_types'] = 'gif|jpg|png|jpeg';\r\n                        $config['encrypt_name'] = true;\r\n                        $config['field'] = $key;\r\n                        $this->upload->initialize($config);\r\n\r\n                        if (!file_exists($config['upload_path'])) {\r\n                            mkdir($config['upload_path'], 0777, true);\r\n                        }\r\n                        $this->upload->do_upload($config['field']);\r\n                        $upload_data = $this->upload->data();\r\n                        $_POST[$key] = 'movie\/' . $key . '\/' . $upload_data[0]['file_name'];\r\n                    }\r\n                }\r\n      